// useFetchProjects.js
import React, {useState, useEffect} from "react";

function useFetchProjects() {
  const [count, setCount] = useState(0);

  const increment = () => {
    setCount((prevCount) => prevCount + 1);
  };

  const decrement = () => {
    setCount((prevCount) => prevCount - 1);
  };

  return { count, increment, decrement };
}

export default useFetchProjects;
